import React from 'react';

const Images = () => {

    const baseUrl = 'http://127.0.0.1:5000/analyze-mosquitoes'
    const [imageNumber, setImageNumber] = React.useState(null)

    const imageList = [1, 2, 3, 4, 5];

    const buttonContainerStyle = {
        display: 'flex',
        flexDirection: 'column',
        gap: '10px',
    };

    const buttonStyle = {
        backgroundColor: '#E1F4F3',
        padding: '10px',
        borderRadius: '5px',
        cursor: 'pointer',
    };

    return (
        <>
            <div style={buttonContainerStyle}>
                {imageList?.map((item) => (
                    <div style={buttonStyle} key={item}
                        onClick={() => setImageNumber(item)}
                    >
                        Sample {item}
                    </div>
                ))}
            </div>
            <div className='flex justify-center items-center'>
                {imageNumber && <img src={`${baseUrl}/${imageNumber}`} width={500} height={250} />}
            </div>
        </>
    );
};

export default Images;
